INSERT INTO `pages` VALUES (1,'About Us','<h2>About Omnee Home</h2>\r\n\r\n<h3>The only tool your home will ever need</h3>\r\n\r\n<p>A home is where we feel&nbsp;safe. It&#39;s a place where we find peace and rest after a long day. It&#39;s where we gather to be with those close to us. It is often a representation of our&nbsp;tastes and values. It is such an important part of our everyday lives.&nbsp;<br />\r\n<br />\r\nWhen the time comes for an upgrade or repair in your home,&nbsp;who do you choose?&nbsp;Do you have a&nbsp;network of specialists you can trust?&nbsp;With so many options available to you through online advertising, social media and local directories, it can be difficult to know what choice to make. How do you find the balance between&nbsp;quality work&nbsp;and a&nbsp;fair price?&nbsp;How can you be sure that the service provider you hire will be&nbsp;reliable&nbsp;and have&nbsp;good communication?&nbsp;Do you have the time to ensure that&nbsp;everything stays in writing, while also managing the entire process?&nbsp;<br />\r\n<br />\r\nOmnee&nbsp;has created effective&nbsp;solutions&nbsp;to the most common problems homeowners have to deal with, when making upgrades and repairs to our homes.&nbsp;</p>\r\n\r\n<p>When the time comes for an upgrade or repair in your home,&nbsp;who do you choose?&nbsp;Do you have a&nbsp;network of specialists you can trust?&nbsp;With so many options available to you through online advertising, social media and local directories, it can be difficult to know what choice to make. How do you find the balance between&nbsp;quality work&nbsp;and a&nbsp;fair price?&nbsp;How can you be sure that the service provider you hire will be&nbsp;reliable&nbsp;and have&nbsp;good communication?&nbsp;Do you have the time to ensure that&nbsp;everything stays in writing, while also managing the entire process?&nbsp;<br />\r\n<br />\r\nOmnee&nbsp;has created effective&nbsp;solutions&nbsp;to the most common problems homeowners have to deal with, when making upgrades and repairs to our homes.&nbsp;</p>',NULL,1,'2019-03-14 01:12:37','2019-04-24 01:33:02'),(2,'FAQ','<p><strong>Q: How does Omnee make money, and how does your pricing compare to the average in the market? </strong></p>\r\n\r\n<p>R: Great question! We have made our system free for every homeowner to use and we also do not charge our service providers upfront or monthly fees. We make our money by taking a percentage of successfully completed jobs that homeowners like you have approved. That keeps everyone motivated to deliver excellent service. Our service providers experience the value that we bring to their business, and have agreed to lower their margins to allow Omnee to take a percentage. We research our pricing on a monthly basis for every city we serve to ensure that we stay competitive in the market. To be transparent, we place ourselves just above the average price point in the majority of our services. We won&rsquo;t be your cheapest option, but we strive to be the best option in every way. We also know that, although we provide the same level of service as the large companies, we don&rsquo;t charge as much as they do. We are confident that, for the value you get through Omnee, you won&rsquo;t find a better deal. After you experience our time-saving, stress-reducing, and easy-to-use system, you&rsquo;re unlikely to ever go back.</p>\r\n\r\n<p><strong>Q: I feel uneasy about giving up my payment information and other personal details. How can I be sure my information is safe?</strong></p>\r\n\r\n<p>R: We work with a leading payment gateway, Braintree (a Paypal company), which provides us and our customers with the highest level of security available. You may enter your payment information through our app, but we do not store that information. It is stored with the payment company. In addition, we guarantee that we will never provide our customers&#39; personal information to any third party for any reason. This is clear in our Privacy Policy. If you would like to discuss this further to gain a better understanding of how we protect your information, please contact us us at any time!</p>\r\n\r\n<p><strong>Q: How do you deal with disputes between homeowners and service providers?</strong></p>\r\n\r\n<p>R: We understand that mistakes will be made from time to time when humans are involved. If there is a dispute regarding price, quality of work or any other issue, we have a process for working things out. It starts with clicking the &quot;dispute&quot; button instead of the &quot;approve&quot; button when our service provider marks the job as complete. If a problem arises before the job is completed, we have made it easy to contact us through the app, website or by phone to begin working through the problem. Fairness is at the core of the Omnee brand, and we are committed to upholding that. We are confident that every problem has a fair solution, so if you ever have an issue, please don&rsquo;t hesitate to reach out to us!</p>',NULL,1,'2019-03-14 01:12:37','2019-04-16 02:45:03'),(3,'Terms & Conditions','<p><strong>Welcome to Omnee Home!</strong></p>\r\n\r\n<p>These terms and conditions outline the rules and regulations for the use of Omnee Technologies Corp.&#39;s Website, located at www.omnee.ca.</p>\r\n\r\n<p>By accessing this website we assume you accept these terms and conditions. Do not continue to use Omnee Home if you do not agree to take all of the terms and conditions stated on this page. Our Terms and Conditions were created with the help of the&nbsp;<a href=\"https://termsandconditionsgenerator.com/\">Terms And Conditions Generator</a>&nbsp;and the&nbsp;<a href=\"https://privacy-policy-template.com/\">Privacy Policy Template</a>.</p>\r\n\r\n<p>The following terminology applies to these Terms and Conditions, Privacy Statement and Disclaimer Notice and all Agreements: &quot;Client&quot;, &quot;You&quot; and &quot;Your&quot; refers to you, the person log on this website and compliant to the Compa