INSERT INTO `system_email_templates` VALUES (1,'Customer registration acknowledgement Email','1','Customer registration acknowledgement Email','Omnee','Omnee@gmail.com',NULL,NULL,'<p>Hello #CUSTOMER_NAME#</p>\r\n\r\n<p>Welcome to #PROJECT_NAME#</p>\r\n\r\n<p>Thank you for registration into omnee application.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-16 07:52:46'),(2,'Customer Registration email to Admin','2','Customer Registration email to Admin','Omnee','Omnee@gmail.com',NULL,NULL,'<p>Hello #SYSTEM_ADMIN_NAME#,</p>\r\n\r\n<p>New Customer has been registered at our application.</p>\r\n\r\n<p><strong>Customer Details :</strong></p>\r\n\r\n<p><strong>Name :&nbsp;</strong>#CUSTOMER_NAME#</p>\r\n\r\n<p><strong>EMAIL :&nbsp;</strong>#CUSTOMER_EMAIL#</p>\r\n\r\n<p>#SYSTEM_ADMIN_URL#</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>\r\n\r\n<p>&nbsp;</p>',1,NULL,'2019-04-10 04:57:47'),(3,'Welcome email to User (Customer, provider and admin)','3','Welcome email to User','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #USER_NAME#</p>\r\n\r\n<p>Welcome to #PROJECT_NAME#</p>\r\n\r\n<p>Thank you for registration into omnee application.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-16 10:05:18'),(4,'Forgot Password for Admin.','4','Forgot Password for admin.','Omnee','omnee@gmail.com',NULL,NULL,'<p>You are receiving this email because we received a password reset request for your account.</p>\r\n\r\n<p>#ACTION_LINK#</p>\r\n\r\n<p>If you did not request a password reset, no further action is required.</p>',1,NULL,'2019-04-11 06:31:15'),(5,'Forgot Password for Customer.','5','Forgot Password for Customer.','Omnee','omnee@gmail.com',NULL,NULL,'<p>You are receiving this email because we received a password reset request for your account.</p>\r\n\r\n<p>#ACTION_LINK#</p>\r\n\r\n<p>If you did not request a password reset, no further action is required.</p>',1,NULL,'2019-04-16 06:20:57'),(6,'Forgot Password for Provider.','6','Forgot Password for Provider.','Omnee','omnee@gmail.com',NULL,NULL,'<p>You are receiving this email because we received a password reset request for your account.</p>\r\n\r\n<p>#ACTION_LINK#</p>\r\n\r\n<p>If you did not request a password reset, no further action is required.</p>',1,NULL,'2019-04-11 06:31:03'),(7,'Quote Request to Vendor','7','Quote Request to Vendor','Omnee','omnee@gmail.com',NULL,NULL,'<p>You have received a new quote request from customer - #CUSTOMER_NAME#</p>',1,NULL,'2019-04-10 04:55:40'),(8,'Quote Request Accepted Notification to Customer','8','Quote Request Accepted Notification to Customer','Omnee','omnee@gmail',NULL,NULL,'<p>Hello #CUSTOMER_NAME#</p>\r\n\r\n<p>Your quote request #JOB_NUMBER# has been accepted by #VENDOR_NAME#&nbsp;</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:54:59'),(9,'Quote Request Rejected By Vendor, Notification to Customer','9','Quote Request Rejected By Vendor','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #CUSTOMER_NAME#</p>\r\n\r\n<p>Your quote request #JOB_NUMBER# has been rejected by #VENDOR_NAME#&nbsp;</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:54:11'),(10,'Quote Received Notification to Customer','10','Quote Received Notification to Customer','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #CUSTOMER_NAME#</p>\r\n\r\n<p>You have received new quotation for job-#JOB_NUMBER# by #VENDOR_NAME#.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:54:01'),(11,'Quote Accepted Notification to Vendor','11','Quote Accepted Notification to Vendor','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #VENDOR_NAME#</p>\r\n\r\n<p>Your job quotation for job-#JOB_NUMBER# has been approved&nbsp;by #CUSTOMER_NAME#.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:53:34'),(12,'Quote Rejected By Customer Notification to Provider','12','Quote Rejected By Customer Notification to Provider','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #VENDOR_NAME#</p>\r\n\r\n<p>Your job quotation for job-#JOB_NUMBER# has been rejected by #CUSTOMER_NAME#.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:53:08'),(13,'Contact us Acknowledgement to user','13','Contact us Acknowledgement to user','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #USER_NAME#</p>\r\n\r\n<p>Thank you for filling your information !</p>\r\n\r\n<p>We have received your message and would like to thank you for writing to us.&nbsp;</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 06:07:33'),(14,'Contact Form to Admin','14','Contact Form to Admin','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #SYSTEM_ADMIN_NAME#</p>\r\n\r\n<p>You have received new contact us detail by the user.<br />\r\n<strong>Contact Us Detail:</strong></p>\r\n\r\n<p>Name : #USER_NAME#</p>\r\n\r\n<p>Email : #USER_EMAIL#</p>\r\n\r\n<p>Phone Number : #USER_PHONE_NUMER#</p>\r\n\r\n<p>Reason : #USER_REASON#</p>\r\n\r\n<p>Comment : #USER_COMMENT#</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-11 06:37:12'),(15,'Subscription purchase to Customer','15','Subscription purchase to Customer','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #CUSTOMER_NAME#,</p>\r\n\r\n<p>Thank you for purchaseing&nbsp;subscription plan - #SUBSCRIPTION_PLAN_NAME#.</p>\r\n\r\n<p>Your subscription plan duration #START_DATE# to #END_DATE#.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:52:16'),(16,'Subscription purchase to Admin','16','Subscription purchase to Admin','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #SYSTEM_ADMIN_NAME#,</p>\r\n\r\n<p>New subscription plan purchased by #CUSTOMER_NAME#</p>\r\n\r\n<p><strong>Plan Detail :</strong></p>\r\n\r\n<p><strong>Customer Name :&nbsp;</strong>#CUSTOMER_NAME#</p>\r\n\r\n<p><strong>Customer Email :&nbsp;</strong>#CUSTOMER_EMAIL#</p>\r\n\r\n<p><strong>Customer Phone Number :&nbsp;</strong>#CUSTOMER_PHOINE_NUMBER#</p>\r\n\r\n<p><strong>Subscription Plan Name : </strong>#SUBSCRIPTION_PLAN_NAME#</p>\r\n\r\n<p><strong>Subscription Plan Duration : </strong>#SUBSCRIPTION_PLAN_DURATION#</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:51:32'),(17,'Quote Completed Notification to Customer to Rate','17','Quote Completed Notification to Customer to Rate','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #CUSTOMER_NAME#,</p>\r\n\r\n<p>Your job (#JOB_NUMBER#) has been completed by #VENDOR_NAME#.</p>\r\n\r\n<p>Now you can give rate to that service provider.</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:51:06'),(18,'Quote closed Notification to provider to Rate','18','Quote closed Notification to provider to Rate','Omnee','omnee@gmail.com',NULL,NULL,'<p>Hello #VENDOR_NAME#,</p>\r\n\r\n<p>Your job(#JOB_NUMBER#) has been closed by #CUSTOMER_NAME#.</p>\r\n\r\n<p>Now you can give rate to that customer.&nbsp;</p>\r\n\r\n<p><strong>Regards,</strong></p>\r\n\r\n<p>#SYSTEM_COMPANY_NAME#</p>\r\n\r\n<p>#SYSTEM_WEBSITE_URL#</p>',1,NULL,'2019-04-10 04:50:39'),(19,'Quote or Job Status Change Notification to customer','19','Quote or Job Status Change Notification to customer','Omnee','omnee@gmail.com',NULL,NULL,'<p>Quote or Job Status Change Notification to customer&nbsp;</p>',1,NULL,'2019-04-10 05:57:40'),(20,'Quote or Job Status Change Notification to vendor','20','Quote or Job Status Change Notification to vendor','Omnee','omnee@gmail.com',NULL,NULL,'<p>Quote or Job Status Change Notification to vendor</p>',1,NULL,'2019-04-10 05:57:32'),(21,'Email to admin for No provider acceptance for quote','21','Email to admin for No provider acceptance for quote','Omnee','omnee@gmail.com',NULL,NULL,'<p>Email to admin for No provider acceptance for quote</p>',1,NULL,'2019-04-23 01:29:51');
